import React, { Component, useContext} from 'react'
import ReactDOM from 'react-dom';
import {LocationContextConsumer} from '../components/LocationContext.js';
import Loading from '../components/loading.js';

import SideMenu from '../components/sideMenu.js'
import WelcomeSection from '../components/welcomeSection.js'
import FridgeMagnetsSection from '../components/fridgeMagnetsSection.js'


const App = (props) => {
  const {isReady} = useContext(LocationContextConsumer) 

  return(isReady)
}

export default App;
